// import classes from "./MealItem.module.css";
import classes from "./AvailableMeals.module.css";
const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Chikken Tikka",
    description: "Grilled Spicy Chicken",
    price: 250,
  },
  {
    id: "m2",
    name: "Biryani",
    description: "Masala Rice with beef",
    price: 220,
  },
  {
    id: "m3",
    name: "Chicken Handi",
    description: "Pakistan special handi",
    price: 450,
  },
  {
    id: "m4",
    name: "Malai Boti",
    description: "Healthy and tendered Chicken",
    price: 300,
  },
];

function AvailableMeals() {
  const mealsList = DUMMY_MEALS.map((meal) => {
    <li>{meal.name}</li>;
  });
  return (
    <section className={classes.meals}>
      <ul>{mealsList}lskanlkn</ul>
    </section>
  );
}

export default AvailableMeals;

